// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "witnet-solidity-bridge/contracts/interfaces/IWitnetPriceRouter.sol";
import "witnet-solidity-bridge/contracts/interfaces/IWitnetPriceFeed.sol";

contract MyContract {

    IWitnetPriceRouter immutable public witnetPriceRouter;
    IWitnetPriceFeed[] public priceFeeds;

    /**
     * IMPORTANT: pass the WitnetPriceRouter address depending on
     * the network you are using! Please find available addresses here:
     * https://docs.witnet.io/smart-contracts/price-feeds/contract-addresses
     */
    constructor(IWitnetPriceRouter _router) {
        witnetPriceRouter = _router;
        updatePriceFeeds();
    }

    /// Detects if the WitnetPriceRouter is now pointing to different IWitnetPriceFeed implementations:
    function updatePriceFeeds() public {
        // Add new price feeds here
        priceFeeds.push(getPriceFeed(bytes4(0x21a79821))); // CELO-EUR
        priceFeeds.push(getPriceFeed(bytes4(0x5e050002))); // ETH-EUR
    }

    function getPriceFeed(bytes4 _selector) internal view returns (IWitnetPriceFeed) {
        IERC165 priceFeed = witnetPriceRouter.getPriceFeed(_selector);
        return IWitnetPriceFeed(address(priceFeed));
    }

    function getAllPriceFeeds() public view returns (IWitnetPriceFeed[] memory) {
        return priceFeeds;
    }
}

